import React from 'react';
import styles from './dialogs.module.css';
import DialogsItem from './dialogItems/DialogItems';
import MessagesItem from './messagesItems/MessagesItem';



const Dialogs = () => {

    let dialogsData = [
        { id: 1, name: 'Anar' },
        { id: 2, name: 'Vova' },
        { id: 3, name: 'Danya' },
    ]

    let messagesData = [
        { id: 1, message: 'Hello' },
        { id: 2, message: 'How are you ?' },
        { id: 3, message: 'My name is Anar' },
    ]

    let dialogsElement = dialogsData.map((item, index) => {
        return <DialogsItem key = {index} id = {item.id} name = {item.name}/>
    })

    let messageElement = messagesData.map((item, index) => {
        return <MessagesItem key = {index} id = {item.id} message = {item.message} />
    })
    return <div className={styles.blockDialogs}>
        <div className={styles.dialogsItems}>
            {dialogsElement}
        </div>
        <div className={styles.blockMessages}>
            <MessagesItem message='Hello' />
            <MessagesItem message='How are you?' />
            <MessagesItem message='My name is Anar' />
        </div>
    </div>
}

export default Dialogs;
